import styled from "styled-components";

export default function MainPage() {
    return (
        <>
        <Header>
            <span>Olá, Fulano</span>
            <ion-icon name="exit-outline"></ion-icon>
        </Header>
        <Content>
            <span>Não há registros de </span><span>entrada ou saída</span>
        </Content>
        <Buttons>
            <Box>
                <ion-icon name="add-circle-outline"></ion-icon>
                <span>Nova</span><span> entrada</span>
            </Box>
            <Box>
                <ion-icon name="remove-circle-outline"></ion-icon>
                <span>Nova saída</span>
            </Box>
        </Buttons>
        </>
    );
}
const Header = styled.div`
    width: 326px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    font-size: 24px;
    color: #FFFFFF;
    font-family: 'Raleway';
    font-weight: bold;

    ion-icon {
        font-size: 30px;
    }
`
const Content = styled.div`
    width: 326px;
    height: 446px;
    background-color: #FFFFFF;
    border-radius: 5px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    flex-wrap: wrap;
    span {
        font-family: 'Raleway';
        font-size: 20px;
        color: #868686;
    }
`
const Buttons = styled.div`
    width: 326px;
    display: flex;
    margin-top: 15px;
    justify-content: space-between;
`
const Box = styled.div`
    width: 155px;
    height: 114px;
    border-radius: 5px;
    background-color: #A328D6;
    color: #FFFFFF;
    display: flex;
    flex-direction: column;
    padding-left: 5px;
    justify-content: space-around;
    span {
        font-family: 'Raleway';
        font-size: 17px;
        font-weight: bold;
    }
    ion-icon {
        font-size: 25px;
    }

`
